script: |
  super -f text -I q3412.spq | sort > q3412.out

inputs:
  - name: q3412.spq
    data: |
      SELECT - col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 + col0 <> ( + ( - col2 ) / + col0 + + 59 - + 38 );
  - name: tab2

outputs:
  - name: q3412.out
    data: |
      -46
      -64
      -75
